import request from '@/router/axios'

    export function addObj (obj) {
        return request({
            url: '/concern/RdbSource/add',
            method: 'post',
            data: obj
        })
    }

export function handleCheck (obj) {
    return request({
        url: '/concern/RdbSource/check',
        method: 'get',
        params: obj
    })
}
